(ns worksheet-invariants
  (:require [gorilla-plot.core :as plot]))
(require '[signature-invariants.invariants :as inv] :reload)
(require '[hopf-algebra.linear-combination :as lc])
(require '[hopf-algebra.shuffle-algebra :as sa])
