(defn print-list-of-so-invariants [dim order]
  (println "dim="dim", weight="order)
  (println (apply str (interpose "\n"(map (comp lc/lc-to-str incer) (inv/just-independents (inv/so-invariants dim order) dim order ))))))

(doseq [ [dim order] [ [3 3] [3 6] [4 2] [4 4] ] ]
  (print-list-of-so-invariants dim order))
